import React from "react";
import {
  Grid,
  CardContent,
  Typography,
  Card,
  CardHeader,
  Divider,
  makeStyles,
  useTheme,
} from "@material-ui/core";
import { FormControlLabel, Collapse, Paper, Switch } from "@material-ui/core/";

const useStyles = makeStyles({
  root: {
    minWidth: 275,
  },
  bullet: {
    display: "inline-block",
    margin: "0 2px",
    transform: "scale(0.8)",
  },
  title: {
    fontSize: 14,
  },
  pos: {
    marginBottom: 12,
  },
  CardContent: { backgroundColor: "#E5E5E5" },
});

const getHeaderColor = (countrySource) => {
  // eslint-disable-next-line react-hooks/rules-of-hooks
  const theme = useTheme();
  switch (countrySource) {
    case "Hong Kong":
      return theme.palette.primary.dark;
    case "US":
      return theme.palette.warning.dark;
    default:
      return theme.palette.success.dark;
  }
};

const CultureCards = (props) => {
  const classes = useStyles();
  const [checked, setChecked] = React.useState(false);
  const { countrySource, information } = props;

  const handleChange = () => {
    setChecked((prev) => !prev);
  };

  const cultureList = information.map((data) => {
    return (
      <Grid item xs={12} md={12} key={data._id}>
        <Card className={classes.root}>
          <CardHeader
            titleTypographyProps={{ variant: "body1" }}
            style={{
              backgroundColor: getHeaderColor(countrySource),
              color: "white",
            }}
            title={data.name}
          ></CardHeader>
          <CardContent className={classes.CardContent}>
            <Typography variant="body2">
              Description: {data.description}
            </Typography>
            <Divider />
            <Typography variant="body2">
              Report Dates: {data.reportDate}
            </Typography>
          </CardContent>
        </Card>
      </Grid>
    );
  });

  return (
    <Grid container spacing={3}>
      {cultureList}
    </Grid>
  );
};

export default CultureCards;
